import React from 'react';
import Header from "./Header";
import {
  Container, Row, Col, Form, Input, Button, Navbar, Nav,
  NavbarBrand, NavLink, NavItem, UncontrolledDropdown,
  DropdownToggle, DropdownMenu, DropdownItem
} from 'reactstrap';

function App() {
  return (
    <div className="App">
      <Container>
        <Row>
          <Col><Header /></Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
